export const buildingRouter={
	path:'/building',
	meta:{
		title:'房产档案'
	},
	component:()=>import('./index'),
	children:[
		{
			path:'/building',
			name:'building',
			meta:{
				title:'全部房产',
				nav:true,
				layout:'slider'
			},
			component:()=>import('./list')
		},
		{
			path:'/building/import',
			name:'importbuilding',
			meta:{
				title:'房产导入',
				nav:true,
				layout:'slider'
			},
			component:()=>import('./create')
		},
		
	]
}
